import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Home from './pages/Home';

function App() {
  return (
    <Router>
      <div className="App flex flex-col gap-4">
        <Head className="fixed top-0 left-0 right-0 z-50" />
        <div className="flex flex-col gap-4 w-100 px-4 mt-20"> {/* Adjust the top margin to account for the fixed header */}
          <Routes>
            <Route path="/" exact element={<Home />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
